import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Focus and type a partial search term to trigger autocomplete
    await page.click('#searchInput');
    await page.type('#searchInput', 'iph', { delay: 100 });

    // Wait for the search suggestions dropdown to appear
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });

    // Take screenshot of suggestions
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_suggestions.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_suggestions.png'));

    // Extract suggestion items' text
    const suggestions = await page.$$eval('.search-suggestions .suggestion-item', els => els.map(e => e.textContent.trim()));

    // Click the first suggestion if available
    if (suggestions.length > 0) {
      await page.click('.search-suggestions .suggestion-item');
      // Wait for the search results section to appear
      await page.waitForSelector('.search-results', { timeout: 5000 });
      // Take screenshot of search results
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_results.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_results.png'));
    }

    // Extract the search input value after suggestion selection
    const searchInputValue = await page.$eval('#searchInput', el => el.value);

    // Extract the search results count text
    let resultsCount = '';
    if (await page.$('.results-count')) {
      resultsCount = await page.$eval('.results-count', el => el.textContent.trim());
    }

    return {
      success: true,
      action: "Tested search autocomplete: triggered suggestions, selected a suggestion, and verified search results.",
      extractedData: {
        suggestions,
        selectedSuggestion: suggestions.length > 0 ? suggestions[0] : null,
        searchInputValue,
        resultsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
